import React from "react";
import IngredientStatic from "../data/IngredientStatic";

const Ingredient = () => {
  const ingredientArrObj = IngredientStatic;
  console.log(ingredientArrObj);
  const ingredientNames = ingredientArrObj.map((ingredient) => {
    ingredient.name;
  });
  console.log(ingredientNames);

  return (
    <div className="container">
      Ingredient Container
      <div className="row">
        <div className="col-6">Col1</div>
        <div className="col-6">Col2</div>
      </div>
    </div>
  );
};

export default Ingredient;
